  false,\n\t\"url\": null,\n\t\"notes\": \"This ASCII dataset contains monthly mean
  temperatures for 102 Forecast Divisions within the conterminous U.S. and is derived
  from the monthly NCDC climate division data. These data are from daily reports from
  cooperative observers as well as first order stations. The CPC Forecast division
  data combines NCDC regions to yield regions of approximately equal area throughout
  the conterminous U.S. Data represent the approximate area average temperature of
  each region.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
